// SPDX-License-Identifier: MIT
pragma solidity ^0.8.6;
pragma experimental ABIEncoderV2;

import "@openzeppelin/contracts/utils/math/SafeMath.sol";

import "../pool/DaoPool.sol";
import "../utils/AdminControl.sol";
import "../utils/StringUtil.sol";

contract Voting is AdminControl, StringUtil {
    using SafeMath for uint256;

    // structures
    struct VoteInfo {
        string proposalHash;
        address voter;
        uint8 option;
        uint256 amount;
    }

    struct ProposalInfo {
        string ipfsHash;
        uint8 numOfOptions; // max of 255 options
        uint256 minimumStakeValue;
        uint256[] stakedValuePerOption; // index i corresponds to num of tokens staked on option i
        VoteInfo[] votes; // list to track all users who voted on this proposal
        bool isActive;
        bool isLossVoting;
        bool isAllocationProposal;
        bool exists;
    }

    // events
    event CreateProposal(
        string ipfsHash,
        uint8 numOfOptions,
        uint256 minimumStakeValue,
        bool isLossVoting
    );

    event NoLossVote(
        address indexed voter,
        uint256 amount,
        uint8 voteOption,
        string indexed proposalHash
    );

    event LossVote(
        address indexed voter,
        uint256 amount,
        uint8 voteOption,
        string indexed proposalHash
    );

    // storage
    string[] private proposalHashes;
    mapping(string => ProposalInfo) proposals; // lookup table with ipfsHash as key

    DaoPool private daoPool;

    constructor(address[] memory _admins, address _daoPool)
        AdminControl(_admins)
    {
        daoPool = DaoPool(_daoPool);
    }

    // getters
    function getProposalHashes() external view returns (string[] memory) {
        return proposalHashes;
    }

    function getProposalInfo(string memory _ipfsHash)
        public
        view
        returns (ProposalInfo memory)
    {
        require(
            proposals[_ipfsHash].exists,
            "Proposal with given IPFS Hash does not exist"
        );
        return proposals[_ipfsHash];
    }

    function getAllProposals()
        external
        view
        returns (ProposalInfo[] memory proposalInfos)
    {
        proposalInfos = new ProposalInfo[](proposalHashes.length);

        for (uint256 i = 0; i < proposalHashes.length; i++) {
            proposalInfos[i] = proposals[proposalHashes[i]];
        }
    }

    // gets the addresses and amt staked on the given option for the given proposal
    function getVotesForOption(string memory _ipfsHash, uint8 _optionIndex)
        public
        view
        returns (VoteInfo[] memory votes)
    {
        ProposalInfo memory p = getProposalInfo(_ipfsHash);

        VoteInfo[] memory votesForOption = new VoteInfo[](p.votes.length);

        uint256 counter = 0;

        for (uint256 i = 0; i < p.votes.length; i++) {
            VoteInfo memory voteInfo = p.votes[i];
            if (voteInfo.option == _optionIndex) {
                votesForOption[counter] = voteInfo;
                counter++;
            }
        }

        return votesForOption;
    }

    // setters

    // Creates proposal object with given parameters
    function createProposal(
        string memory _ipfsHash,
        uint8 _numOfOptions,
        uint256 _minimumStakeValue,
        bool _isLossVoting,
        bool _isAllocationProposal
    ) external onlyAdmins {
        require(
            _numOfOptions > 1,
            "Need to have more than 1 input option for voting"
        );
        require(
            !proposals[_ipfsHash].exists,
            "Proposal with given IPFS Hash has already been created before"
        );

        ProposalInfo storage newProposal = proposals[_ipfsHash];

        newProposal.numOfOptions = _numOfOptions;
        newProposal.minimumStakeValue = _minimumStakeValue;
        newProposal.stakedValuePerOption = new uint256[](_numOfOptions);
        newProposal.isAllocationProposal = _isAllocationProposal;
        newProposal.isLossVoting = _isLossVoting;
        newProposal.isActive = true;
        newProposal.exists = true;

        proposalHashes.push(_ipfsHash);

        emit CreateProposal(
            _ipfsHash,
            _numOfOptions,
            _minimumStakeValue,
            _isLossVoting
        );
    }

    // Function to close/disable the proposal.
    function setProposalStatus(string memory _ipfsHash, bool _isActive)
        external
        onlyAdmins
        returns (ProposalInfo memory)
    {
        require(
            proposals[_ipfsHash].exists,
            "Proposal with given IPFS Hash does not exist"
        );

        ProposalInfo storage proposal = proposals[_ipfsHash];
        proposal.isActive = _isActive;

        if (!proposal.isLossVoting && !proposal.isActive) {
            // send money back if no loss vote proposal has ended
            for (uint256 i = 0; i < proposal.votes.length; i++) {
                VoteInfo storage voteInfo = proposal.votes[i];
                daoPool.rewardUser(
                    voteInfo.voter,
                    voteInfo.amount,
                    "NoLossCashback"
                );
            }
        }

        return proposal;
    }

    function vote(
        string memory _ipfsHash,
        uint8 _optionIndex,
        uint256 _stakeValue
    ) external {
        require(
            proposals[_ipfsHash].exists,
            "Proposal with given IPFS Hash does not exist"
        );
        ProposalInfo storage proposal = proposals[_ipfsHash];

        require(proposal.isActive, "Proposal is not active");

        require(
            _stakeValue >= proposal.minimumStakeValue,
            "Given Stake Value is below minimum allowable Stake Value"
        );
        require(
            _optionIndex < proposal.numOfOptions,
            "Option Index given is not valid"
        );

        VoteInfo[] memory votesForOption = getVotesForOption(
            _ipfsHash,
            _optionIndex
        );

        // create another lookup table in the future to makes this O(1)
        for (uint256 i = 0; i < votesForOption.length; i++) {
            if (votesForOption[i].voter == msg.sender) {
                revert("User has already voted for this option");
            }
        }

        daoPool.getTokenFrom(msg.sender, _stakeValue, "Vote");

        proposal.stakedValuePerOption[_optionIndex] = SafeMath.add(
            proposal.stakedValuePerOption[_optionIndex],
            _stakeValue
        );

        proposal.votes.push(
            VoteInfo({
                voter: msg.sender,
                amount: _stakeValue,
                proposalHash: _ipfsHash,
                option: _optionIndex
            })
        );

        if (proposal.isLossVoting) {
            emit LossVote(msg.sender, _stakeValue, _optionIndex, _ipfsHash);
        } else {
            emit NoLossVote(msg.sender, _stakeValue, _optionIndex, _ipfsHash);
        }
    }
}
